define('views/notification',[
    'jquery',
    'underscore',
    'backbone',
    'helpers/TemplateHelper',
    'text!templates/notification.dust'
], function ($, _, Backbone, templateHelper, NotificationTemplate) {
    var versa = versa || {};

    versa.NotificationView = Backbone.View.extend({
        templateKey: 'global-error-alert',
        events: {
            'click .js-notification-close': 'closeNotification',
            'click #notification-body': 'coolClose'
        },

        initialize: function (options) {
            this.options = options;
            templateHelper.compile(NotificationTemplate, this.templateKey);
            this.NOTIFICATION_TIMEOUT = 3000;

        },

        render: function () {
            var self = this;
            var data = {
                id: Date.now(),
                type: this.options.type
            };

            if (this.options.msgKey) {
                this.options.msg = $.i18n.prop(this.options.msgKey)
            }

            if (this.options.subType == 'progress') {
                data.isProgress = true;
            }

            if (_.isString(this.options.msg)) {
                data.shortMessage = this.options.msg;
            }

            if (_.isObject(this.options.msg)) {
                data.shortMessage = this.options.msg.shortMessage;
                data.detailedMessage = this.options.msg.detailedMessage;
            }


            this.setElement(templateHelper.renderedOutput(this.templateKey, data));
            self.$el.find(".notification-details--body").on("shown.bs.collapse", function() {
                var ht=$(this).height();
                if(ht > 400){
                    $('.notification-inner-wrapper').addClass("scroll-pane").jScrollPane({autoReinitialise: true});
                }
            });
            self.$el.find(".notification-details--body").on("hide.bs.collapse", function() {
                var api = $('.notification-inner-wrapper').data('jsp');
                api && api.destroy();
                $('.notification-inner-wrapper').removeClass("scroll-pane");
            });
            if(this.options.type === 'error' || this.options.type === 'progress'){
                this.options.autoHide = false;
            }
            if ((this.options.type !== 'error' || this.options.type !== 'progress') && this.options.autoHide !== false) {
                setTimeout(function () {
                    self.closeNotification();
                }, this.NOTIFICATION_TIMEOUT);
            }

            return this;
        },

        closeNotification: function () {
            var self = this;
            this.$el.addClass('notification-hide clearfix');

            setTimeout(function () {
                self.close();
                self.$el.remove();
            }, 200)
        },
        coolClose: function (e) {
            if (e.shiftKey) {
                this.closeNotification();
                e.stopPropagation();
            }
        }
    });

    return versa.NotificationView;

});


