define('helpers/Dialog',[
    'jquery',
    'underscore',
    'backbone',
    'helpers/TemplateHelper',
    'text!templates/dialog.dust'
], function ($, _, Backbone, templateHelper, dialogTemplate) {
    return Backbone.View.extend({
        templateKey: 'cnfm-dialog-template',
        events: {
            'click .js-ok': 'ok',
            'click .js-cancel': 'cancel'
        },
        initialize: function (options) {
            this.options = options;
            templateHelper.compile(dialogTemplate, this.templateKey);
            this.render();
        },
        render: function () {
            this.type = this.options.type || 'info';
            this.$dialogLayer = app.utils.getNewLayer($('#page-container'), 'js-' + this.cid + '-dialog', { cssClasses: 'popup-confirm' });
            var message = this.options.message || $.i18n.prop(this.options.messageKey);
            var templateData = {
                type : this.type,
                message : message
            };
            this.options.cancelLabel && (templateData.cancelLabel = this.options.cancelLabel);
            this.options.okLabel && (templateData.okLabel = this.options.okLabel);
            this.options.title && (templateData.title = this.options.title);

            this.setElement(templateHelper.renderedOutput(this.templateKey, templateData));

            this.$dialogLayer.find('.popup-container').html(this.el);

            $('#page-content').prepend(this.$dialogLayer);
            this.$dialogLayer.show();
            return this;
        },
        ok : function(){
            this.close();
            this.options.callback && this.options.callback.call(this.options.scope);
        },
        cancel: function(){
            this.type != 'confirm' ? this.ok() : this.close();
        },
        onClose : function(){
            app.utils.removeLayer(this.$dialogLayer);
        }
    });
});

