/**
 * @fileOverview
 * Defines utility functions used by listing related classes.
 */
define('helpers/gridHelper',[ 'jquery',
    'underscore',
    'backbone',
    'app'], function ($, _, Backbone, app) {
    var gridHelper = {};
    // max number lines that can be displayed in a grid cell before view more link is shown.
    gridHelper.maxLinesPerCell = 3;
    // default label for view more link.
    gridHelper.viewMoreLabel = 'View More...';

    /**
     * Returns the markup for view more link.
     * @param  {String} columnName    - name of the column in which the cell resides.
     * @param  {String} classesToBind - any classes to associate with link.
     * @return {String}               - html markup for the link.
     */
    gridHelper.getViewMoreLink = function (columnName, classesToBind, targetType) {
        if (typeof targetType != 'undefined' && targetType != 'popup'&& targetType != 'custom') {
            return '...';
        }
        return "<a class='view-more-link link margin-l-5px" + (classesToBind ? (' ' + classesToBind) : '') + "' data-column='" + columnName + "'>" + this.viewMoreLabel + '</a>';
    };
    /**
     * Creates style attribute value using the css properties defined in the specified object.
     * Mainly for use in the html markup.
     * @param  {Object} css hash of css properties.
     * @return {String}     style attribute value.
     */
    gridHelper.serializeCSS = function (css) {
        var style = '';
        _.each(css, function (value, key) {
            if (style.length > 0) {
                style += ';';
            }
            style += key + ':' + value + '!important';
        });
        return style;
    };
    /**
     * Extracts information about the row and column from the element associated with event object and activates popover plugin
     * for showing more information about the cell.
     * @param  {Event} e    - the event object
     * @param  {jQuery} grid - the grid element.
     */
    gridHelper.showPopover = function (e, grid) {
        e.stopPropagation();
        var $link = $(e.currentTarget);
        var colName = $link.attr('data-column');
        var row;
        if (!grid) {
            row = $link.closest('tr');
            grid = row.closest('table');
        }
        var columnInfo = _.findWhere(grid.getGridParam('colModel'), {name: colName});
        if (columnInfo.targetType) {
            if (!row) {
                row = $link.closest('tr');
            }
            var array = grid.getCell(row.attr('id'), columnInfo.name);
            var css = columnInfo.popoverCSS ? gridHelper.serializeCSS(columnInfo.popoverCSS) : undefined;
            var html = '<div class="scroll-pane"' + (css ? (" style='" + css + "'") : '') + '>';
            _.each(array, function (item) {
                html += '<div class="cell-detail-record" title="' + item + '">' + item + '</div>';
            });
            html += '</div>';
            this.applyPopover($link, html, !row.prev().hasClass('jqgfirstrow') && row.next().length == 0 ? -35 : 0);
        }
    };
    /**
     * Applies jScrollPane to the popover container
     */
    gridHelper.applyScroll = function () {
        var scl = $('.popover-content').find('.scroll-pane');
        scl.attr('data-jsp-bound', 'true');
        scl.addClass('scroll-pane');
        scl.bind('jsp-scroll-x', function (event) {
            event.stopPropagation();
        });
        scl.jScrollPane({verticalDragMinHeight: 20});
    };
    /**
     * Applies popover api to the given element.
     * @param  {jQuery} $src    - element on which to invoke the API.
     * @param  {String} content - content to display in the popup
     * @param  {Number} posVar  - top offset of the popup to vary by.
     */
    gridHelper.applyPopover = function ($src, content, posVar) {
        var _self = this;
        $src.popover({
            callback: _self.applyScroll,
            trigger: 'manual',
            html: true,
            content: function () {
                return content;
            }
        });
        $src.popover('show');
        var $popover = $src.siblings('.popover');
        if (posVar) {
            $popover.css({top: (parseFloat($popover.css('top')) + posVar) + 'px'});
        }
        $popover.on('mouseleave', function () {
            $src.popover('hide');
            $src.popover('destroy');
        });
    };
    /**
     * Formats cell title when displaying more than 3 lines of record in the cell. This is applicable only when view more
     *  link is enabled on the cell.
     * @param  {String} rowId          row id
     * @param  {String} val            cell value.
     * @param  {Object} rowObject      row data.
     * @param  {Function} cellAttrMethod custom cell attributes method defined by the column in the colModel in gridSchema.
     * @return {String}                Html attributes for the cell element.
     */
    gridHelper.formatCellTitle = function (rowId, val, rowObject, cellAttrMethod) {
        var attrs = cellAttrMethod && typeof cellAttrMethod == 'function' ? cellAttrMethod(rowId, val, rowObject) : cellAttrMethod;

        if ((!attrs || attrs.indexOf('title=') == -1) && val.lastIndexOf(gridHelper.viewMoreLabel) != -1) {
            if (val.indexOf('<') == 0) {
                try {
                    val = $(val).text();
                } catch(E) {}
            }
            var arr = val.split('\n');
            var str = '';
            var strLen = arr.length<this.maxLinesPerCell?arr.length:this.maxLinesPerCell;
            for (var i = 0;i < strLen;i++) {
                str += arr[i] + '\n';
            }
            var title = "title='" + str + '...' + "'";
            attrs = (attrs ? (attrs + ' ') : '') + title;
        }
        return attrs;
    };
    /**
     * Gets the array formatter for a cell.
     * @param  {String} separator - string to use for joining the records in the array.
     * @param  {String} jsonAttr  - attribute to pluck from the object if the cell value is array of objects.
     * @return {Function}         function that can be used as cell formatter for a column in the grid.
     */
    gridHelper.getArrayFormatter = function (separator, jsonAttr) {
        return function (cellValue, options, rowData) {
            var array = jsonAttr ? _.pluck(cellValue, jsonAttr) : cellValue;
            if ($.isArray(separator)) {
                var textValue = '';
                _.each(array, function (x) {
                    textValue += separator[0] + x + separator[1];
                });
                return textValue;
            }
            return array.length == 1 ? array[0] : array.join(separator);
        };
    };
    /**
     * Deletes the property from the specified object and any nested objects.
     * @param  {Object} obj source object from which key is to be delete
     * @param  {String} key name of the property
     */
    gridHelper.deleteDeep = function (obj, key) {
        var _this = this;
        _.each(obj, function (v, k) {
            if (_.isArray(v) || _.isObject(v)) {
                _this.deleteDeep(v, key);
            }
            if (k == key) {
                delete obj[k];
            }
        });
    };
    /**
     * Generic setTOAPIFormat for inline editing from listing screen. This method is used only when the schema for the cell
     * does not define any custom setTOAPIFormat function for converting the data into a format accepted by the server for
     * a given object.
     * @param  {Object} postObject        Object being saved on the server.
     * @param  {Object} updatedAttributes Updates attributes for a cell.
     * @param  {Object} schema            Schema used to render the field for editing the cell value.
     * @param  {String} rootKey           Root key for the data being sent. A new object is created with this key and
     *                                    the object data is set against this key.
     * @return {Object}                   Returns formatted data.
     */
    gridHelper.applyAPIFormatting = function (postObject, updatedAttributes, schema, rootKey) {
        var path = schema.loadModelPath;
        var serverKey = schema.serverKey;
        var rootObject = postObject;
        if (path) {
            var array = path.split('\.');
            var arrayLength = array.length, len = arrayLength - 1;
            if (array[len] != serverKey) {
                len = arrayLength;
            }
            for (var i = 0;i < len;i++) {
                var obj = rootObject[array[i]];
                if (!obj) {
                    rootObject[array[i]] = (obj = {});
                }
                rootObject = obj;
            }
        }
        rootObject[serverKey] = updatedAttributes[serverKey];
        this.deleteDeep(postObject, '_y:self');
        this.deleteDeep(postObject, '_self');
        this.deleteDeep(postObject, '$idx');
        this.deleteDeep(postObject, '$len');
        if (postObject.organizationName) {
            delete postObject.organizationName;
        } else if (postObject.organisationName) {
            delete postObject.organisationName;
        }
        if (path && serverKey != path) {
            delete postObject[serverKey];
        }
        var data = {};
        data[rootKey] = postObject;
        return data;
    };
    /**
     * Ensures path represented in JSON dot notation exists in the given object. If a key does not exist
     * then a new object is created against the key. For e.g. For path a.b.c and object {a:{}}, the resultant object
     * is {a:{b:{c:{}}}}
     *
     * @param  {Object} object Source object.
     * @param  {String} path   path in dot notation. e.g. a.b.c
     */
    gridHelper.ensureObjectInPath = function (object, path) {
        var array = path.split('\.');
        var arrayLength = array.length;
        for (var i = 0;i < arrayLength;i++) {
            var obj = object[array[i]];
            if (!obj) {
                object[array[i]] = (obj = {});
            }
            object = obj;
        }
    };
    /**
     * Sets the given array value against the key in the specified object. If the value is null/undefied and empty, then specified
     * key is deleted from the object.
     * @param {Object} object target object in which the value is to be set.
     * @param {String} key    key to update.
     * @param {Array} value  value to set
     */
    gridHelper.setArrayValue = function (object, key, value) {
        if (!value || value == null || value.length == 0) {
            delete object[key];
        } else {
            object[key] = value;
        }
    };
    /**
     * Updates the pager controls i.e. next/previous/inputbox elements found under the specified "pager" element based
     * on the current page and total number of pages.  It is required that next, previous and inputbox elements contain classes grid-next-page,
     * grid-prev-page and current-list respectively.
     * Based on the currentPage and totalPages, next and prev controls are either enabled or disabled.
     * @param  {jQuery} pager       - pager element.
     * @param  {Number} currentPage - currently loaded page in the grid.
     * @param  {Number} totalPages  - Total pages available.
     */
    gridHelper.updatePager = function (pager, currentPage, totalPages) {
        var prev = pager.find('.grid-prev-page');
        var next = pager.find('.grid-next-page');
        pager.find('.current-list').val(currentPage);
        if(totalPages == 1) {
            $('.current-list').attr('disabled','true');
        }else {
            $('.current-list').removeAttr('disabled');
        }
        if (currentPage > 1) {
            prev.addClass('icon-prev-list');
            prev.removeClass('icon-prev-list-grey');
        } else {
            prev.addClass('icon-prev-list-grey');
            prev.removeClass('icon-prev-list');
        }
        if (currentPage < totalPages) {
            next.addClass('icon-next-list');
            next.removeClass('icon-next-list-grey');
        } else {
            next.addClass('icon-next-list-grey');
            next.removeClass('icon-next-list');
        }
    };
    /**
     * Creates a shallow copy of the gridSchema and copies the filter function into it.
     * @param  {Object} gridSchema - gridSchema
     * @param  {Function} filter_fn - function for filtering the records from the backend.
     * @return {Object}            modified gridSchema.
     */
    gridHelper.applyFiltering = function (gridSchema, filter_fn) {
        gridSchema = $.extend({}, gridSchema);
        gridSchema.filterFunction = filter_fn;
        return gridSchema;
    };
    /**
     * Finds id of the row in the grid by cell value. This method loops through all the rows in the grid and returns the
     * ID of the first matching row.
     *
     * @param  {jQuery} grid        element on which jQgrid is initialized.
     * @param  {String} cellname    column name
     * @param  {String} targetValue cell value.
     * @return {String}             row id
     */
    gridHelper.findRowId = function (grid, cellname, targetValue) {
        var dataIds = grid.getDataIDs();
        for (var i = 0;i < dataIds.length;i++) {
            if (grid.getRowData(dataIds[i])[cellname] == targetValue) {
                return dataIds[i];
            }
        }
        return null;
    };
    gridHelper.convertToCustomCheckbox = function($cboxes) {
        $cboxes.each(function () {
            var $checkbox = $(this);
            if (!$checkbox.parent().hasClass('ciCheckbox')) {
                $checkbox.wrap('<div class="ciCheckbox"></div>');
                $checkbox.after('<label for="'+$checkbox.attr('id')+'" class="icon-chkbx"></label>');
            }
        });
    };
    gridHelper.addStripes = function (gridElement) {

        var gridParent = gridElement.parent(),
            remainingSpace = gridElement.parents(".ui-jqgrid-bdiv").height() - gridElement.height(),
            stripeHeight = 25,
            stripes = Math.floor(remainingSpace/stripeHeight);
        gridParent.find('.js-jqg-stripes').remove();
        var remainingLastSpace = remainingSpace/stripeHeight - stripes;
        if(remainingSpace > 0 && stripes){
            var i = 0, lastRow = gridElement.find('tr:last'),
                isFirstRow = lastRow.hasClass('jqgfirstrow'),
                colors = [
                    isFirstRow ? '#f3f7fa' :  lastRow.prev().hasClass('jqgfirstrow') ? 'white' : lastRow.prev().find('td:eq(1)').css('background-color'),
                    isFirstRow ? '#fff' : lastRow.find('td:eq(1)').css('background-color')
                ],
                stripesWrapper = $("<div class='js-jqg-stripes'></div>").appendTo(gridParent);
            while(stripes-- > 0){
                $("<div></div>").css({height : (stripes ? stripeHeight : (stripeHeight - 1 ))+'px', width : gridElement.width() + 'px', 'background-color' : colors[i++]}).appendTo(stripesWrapper);
                (i == 2) && (i = 0);
            }
            if (remainingLastSpace > 0 ) {
                $("<div></div>").css({height : (remainingLastSpace * stripeHeight)+'px', width : gridElement.width() + 'px', 'background-color' : colors[i++]}).appendTo(stripesWrapper);
                (i == 2) && (i = 0);
            }
        }
    };
    return gridHelper;
});

