        getOrganizationNetworks: function(deviceName, orgName, isTemplate, withInterfaces) {
            var deferred = $.Deferred();
            var construct = isTemplate ? 'template' : 'device';
            var request = $.ajax({
                url: app.constants.APP_ROOT + app.constants.NCS_ROOT + '/devices/' + construct + '/' + deviceName + '/config/orgs/org/' + orgName + '/traffic-identification/using-networks',
                type: 'GET',
                headers: {
                    "accept": 'application/vnd.yang.data+json',
                    "content-type": "application/vnd.yang.data+json"
                }
            });
            request.done(function (response) {
                var networks = response['using-networks'];
                if(withInterfaces && networks && networks.length){
                    $.ajax({
                        url: app.constants.APP_ROOT + app.constants.NCS_ROOT + '/devices/' + construct + '/' + deviceName + '/config/networks/network?select=name;interfaces',
                        type: 'GET',
                        headers: {
                            "accept": 'application/vnd.yang.data+json',
                            "content-type": "application/vnd.yang.data+json"
                        }
                    }).done(function(response){
                        var allNetworks = response.network;
                        networks = _.map(networks, function(nwName){
                            var nwConf = _.findWhere(allNetworks, {name: nwName});
                            return {
                                name: nwName,
                                interfaces: (nwConf && nwConf.interfaces) || []
                            }
                        });
                        deferred.resolve(networks);
                    }).fail(function(response){
                        deferred.resolve([]);
                    });
                } else {
                    deferred.resolve(networks);
                }
            }).fail(function (response) {
                deferred.resolve([]);
            });
            return deferred.promise();
        },
