        getApplicationTags: function(tags, asObject) {
            var obj = {};
            obj.sdwanTag = [];
            obj.securityTag = [];
            obj.generalTag = [];
            _.each(tags, function(value) {
                var originalValue = value;
                value = value.charAt(0).toUpperCase()+ value.slice(1).toLowerCase();
                if (value.substring(0, 2) == 'V_') {
                    value = value.substring(2);
                    value = value.charAt(0).toUpperCase() + value.slice(1).toLowerCase();
                    if (asObject) {
                        obj.sdwanTag.push({
                            key: originalValue,
                            label: value
                        });
                    }else {
                        obj.sdwanTag.push(value);
                    }
                }else if (value.substring(0, 3) == 'Vs_') {
                    value = value.substring(3);
                    value = value.charAt(0).toUpperCase() + value.slice(1).toLowerCase()
                    if (asObject) {
                        obj.securityTag.push({
                            key: originalValue,
                            label: value
                        });
                    }else {
                        obj.securityTag.push(value);
                    }
                }else {
                    if (asObject) {
                        obj.generalTag.push({
                            key: originalValue,
                            label: value
                        });
                    }else {
                        obj.generalTag.push(value);
                    }
                }
            });

            return obj;
        },

