        getRangeMapForMonitoring: function(maxValue){
            var rangeMap = [];
            var division = maxValue/3;
            var start = 0;
            var end = division;
            var count = 1
            while(count <= 3){
                if(count == 3){
                    rangeMap.push({min:start,max:maxValue});
                }else{
                    rangeMap.push({min:start,max:end});
                }

                start = end;
                end = end + division;
                count++;
            }
            return rangeMap;
        },
