        /**
         * This method does Alphanumeric sort
         * @param {Array} dataArray The array to be sorted
         * @param {String} columnName Key name by which the array is to be sorted
         * @return {Array} Sorted array
         * Reference http://www.davekoelle.com/files/alphanum.js
         */
        alphanumericSort: function (dataArray,columnName) {
            var keyName = columnName;
            var alphanum = function (a, b) {
                function chunkify(t) {
                    if(typeof t !== "string"){
                        t = t.toString();
                    }
                    var tz = new Array();
                    var x = 0, y = -1, n = 0, i, j;
                    while (i = (j = t.charAt(x++)).charCodeAt(0)) {
                        var m = (i == 46 || (i >=48 && i <= 57));
                        if (m !== n) {
                            tz[++y] = "";
                            n = m;
                        }
                        tz[y] += j;
                    }
                    return tz;
                }
                var aa = a[keyName] ? chunkify(a[keyName]) : chunkify(a);
                var bb = b[keyName] ? chunkify(b[keyName]) : chunkify(b);
                for (x = 0; aa[x] && bb[x]; x++) {
                    if (aa[x] !== bb[x]) {
                        var c = Number(aa[x]), d = Number(bb[x]);
                        if (c == aa[x] && d == bb[x]) {
                            return c - d;
                        } else return (aa[x] > bb[x]) ? 1 : -1;
                    }
                }
                return aa.length - bb.length;
            }
            return dataArray.sort(alphanum);
        },
        /**
         * This method does Alphanumeric sort
         * @param {Array} dataArray The array to be sorted
         * @param {String} columnName Key name by which the array is to be sorted
         * @return {Array} Sorted array
         * Reference http://www.davekoelle.com/files/alphanum.js
         */
        alphanumericSortWithLowerCase: function (dataArray,columnName) {
            var keyName = columnName;
            var alphanum = function (a, b) {
                function chunkify(t) {
                    var tz = new Array();
                    var x = 0, y = -1, n = 0, i, j;
                    while (i = (j = t.charAt(x++)).charCodeAt(0)) {
                        var m = (i == 46 || (i >=48 && i <= 57));
                        if (m !== n) {
                            tz[++y] = "";
                            n = m;
                        }
                        tz[y] += j;
                    }
                    return tz;
                }
                var aa = (a[keyName] != '') && (a[keyName] ? chunkify(a[keyName].toLowerCase()) : chunkify(a)) || [];
                var bb = (b[keyName] != '') && (b[keyName] ? chunkify(b[keyName].toLowerCase()) : chunkify(b)) || [];
                for (x = 0; aa[x] && bb[x]; x++) {
                    if (aa[x] !== bb[x]) {
                        var c = Number(aa[x]), d = Number(bb[x]);
                        if (c == aa[x] && d == bb[x]) {
                            return c - d;
                        } else return (aa[x] > bb[x]) ? 1 : -1;
                    }
                }
                return aa.length - bb.length;
            }
            return dataArray.sort(alphanum);
        },
        getInBytes:function (size)
        {
            var unit = size.split(/[0-9]+/g).pop().toLowerCase();
            var sizeInUnit = parseFloat(size.substr(0,size.length-1));
            var sizeInBytes = 0;
            var powerCnter  = ['b','kb','mb','gb','tb']
            sizeInBytes = sizeInUnit * Math.pow(1024, powerCnter.indexOf(unit));
            return sizeInBytes;
        },
        toCamelCase:function (s) {
            var expemptedStrings = ['ike','bgp'];
            if(s && (expemptedStrings.indexOf(s.toLowerCase())!=-1)){
                return s.toUpperCase()
            }



            s = (s||'').toLowerCase().replace(/(\b|-)\w/g, function(m) {
                return m.toUpperCase().replace(/-/,' ');
            });
            var originalWord = ['Ip', 'Tcp', 'Icmp', 'Udp', 'Icmpv6', 'Dos', 'Sctp', 'Ipv6', 'Oip', 'Qos']
            var replacedString = ['IP', 'TCP', 'ICMP', 'UDP', 'ICMPv6', 'DOS', 'SCTP', 'IPv6', 'OIP', 'QOS']
            _.each(originalWord, function(word, index){
                s = s.split(word).join(replacedString[index]);
            });
            return s;

        },

        /**
         * Converts large number to easily human readable format
         * @param {number} inNum Number
         * @returns {string} representation for number
         */
        convertNumberToKFormat: function (inNum, decPlaces) {
            if(isNaN(Number(inNum))){
                //console.error("Number Format Error:: Input cannot be parsed as number");
                return inNum;
            }
            decPlaces = Math.pow(10, decPlaces || 0);

            // Enumerate number abbreviations
            var abbrevArray = ['K', 'M', 'G', 'T', 'P', 'E', 'Z', 'Y'];

            // Go through the array backwards, so we do the largest first
            for (var i = abbrevArray.length - 1; i >= 0; i--) {

                // Convert array index to "1000", "1000000", etc
                var size = Math.pow(10, (i + 1) * 3);

                // If the number is bigger or equal do the abbreviation
                if (size <= inNum) {
                    // Here, we multiply by decPlaces, round, and then divide by decPlaces.
                    // This gives us nice rounding to a particular decimal place.
                    var inNum = Math.round(inNum * decPlaces / size) / decPlaces;

                    // Handle special case where we round up to the next abbreviation
                    if((inNum == 1000) && (i < abbrevArray.length - 1)) {
                        inNum = 1;
                        i++;
                    }

                    // Add the letter for the abbreviation
                    inNum += abbrevArray[i];
                    break;
                }
            }
            return inNum;
        },
        convertSimpleNumberToKorMFormat: function(num) {
            var retValue = "0";
            if ( num > 999 && num < 999949) {
                retValue = (num/1000).toFixed(1) + 'K';
            } else if (num >= 999949) {
                retValue = (num/1000000).toFixed(1) + 'M';
            } else {
                retValue = num + "";
            }

            return retValue.split('.0').join('');
        },
        numberWithCommas: function (num) {
            return num.toString().replace(/\B(?=(\d{3})+(?!\d))/g, ",");
        },


