        getDeviceGroupHeaderGrouping: function(colModel, variableMetaData, attributes, autoGenerated, nextGenApiFlag) {
            var returnColModel = [];
            var sortedColModel = colModel;
            var startColumnName = '';
            var numberOfColumns = 0;
            var headerGrouping =  {
                useColSpanStyle : true,
                groupHeaders :[]
            };
            if (variableMetaData) {
                if (!_.isArray(variableMetaData)) {
                    variableMetaData = [variableMetaData];
                }
                if (attributes) {
                    variableMetaData = _.filter(variableMetaData, function(variable) {
                        var foundVariable = _.findWhere(attributes, {name: variable.variable});
                        if (typeof foundVariable != 'undefined') {
                            var autogeneratable = (nextGenApiFlag == true) ? "autogeneratable" : "isAutogeneratable";
                            if (autoGenerated) {
                                if (foundVariable[autogeneratable]) {
                                    return true;
                                }
                                return false;
                            } else {
                                if (foundVariable[autogeneratable]) {
                                    return false;
                                }
                                return true;
                            }
                        }
                        return false;
                    });
                }
                variableMetaData = _.groupBy(variableMetaData, function(o) {
                    if (o.group == 'Virtual routers') {
                        o.group = 'Virtual Routers'
                    }
                    return o.group;
                });
                var allGroups = _.keys(variableMetaData);
                var sortedMetaData = [];
                _.each(allGroups, function(group) {
                    if (group.toUpperCase() != 'Others'.toUpperCase()) {
                        sortedMetaData.push(variableMetaData[group]);
                    }
                });
                _.each(sortedMetaData, function(metaData){
                    metaData && app.utils.alphanumericSortWithLowerCase(metaData, "variable");
                })
                if (variableMetaData['Others']) {
                    sortedMetaData.push(variableMetaData['Others']);
                }
                sortedMetaData = _.flatten(sortedMetaData);
                sortedColModel = [];
                _.each(sortedMetaData, function(variable) {
                    var variableMetaDataObj = _.findWhere(colModel, {name: variable.variable});
                    if (variableMetaDataObj) {
                        sortedColModel.push(variableMetaDataObj);
                    }
                });
                _.each(sortedColModel, function(column) {
                    if (!column.secret) {
                        var isVariable = _.where(sortedMetaData, {variable: column.index});
                        if (isVariable.length > 0) {
                            var group = _.where(headerGrouping.groupHeaders, {titleText: isVariable[0].group});
                            if (group.length> 0) {
                                group[0].numberOfColumns += 1;
                                returnColModel[isVariable[0].group].push(column);
                            }else {
                                returnColModel[isVariable[0].group] = [column]
                                headerGrouping.groupHeaders.push({
                                    startColumnName : column.name,
                                    numberOfColumns: 1,
                                    titleText: isVariable[0].group
                                });
                            }
                        }
                    }
                });
            };
            var newColModel = [];
            /*if(){
                _.each(colModel,function(col, index){
                    (noOfColumns < index) && newColModel.push(col);
                })
            }else {*/
            newColModel = [colModel[0], colModel[1]];
            //}
            if (headerGrouping.groupHeaders.length > 0) {
                _.each(headerGrouping.groupHeaders, function(header) {
                    if (returnColModel[header.titleText]) {
                        _.each(returnColModel[header.titleText], function(col){
                            newColModel.push(col);
                        });
                    }
                });
            }else {
                if (newColModel.length > 2) {
                    newColModel = colModel;
                }
            }
            return {colModel: newColModel, headerGrouping: headerGrouping};
        },
        downloadAttachment: function(response,status,xhr)
        {
            var filename = "";
            var disposition = xhr.getResponseHeader('Content-Disposition');
            if (disposition && disposition.indexOf('attachment') !== -1) {
                var filenameRegex = /filename[^;=\n]*=((['"]).*?\2|[^;\n]*)/;
                var matches = filenameRegex.exec(disposition);
                if (matches != null && matches[1]) filename = matches[1].replace(/['"]/g, '');
            }

            var type = xhr.getResponseHeader('Content-Type');
            var blob = new Blob([response], { type: type });

            if (typeof window.navigator.msSaveBlob !== 'undefined') {
                // workaround for IE
                window.navigator.msSaveBlob(blob, filename);
            } else {
                var URL = window.URL || window.webkitURL;
                var downloadUrl = URL.createObjectURL(blob);

                if (filename) {
                    // use HTML5 a[download] attribute to specify filename
                    var a = document.createElement("a");
                    // safari doesn't support this yet
                    if (typeof a.download === 'undefined') {
                        window.location = downloadUrl;
                    } else {
                        a.href = downloadUrl;
                        a.download = filename;
                        document.body.appendChild(a);
                        a.click();
                    }
                } else {
                    window.location = downloadUrl;
                }

                setTimeout(function () { URL.revokeObjectURL(downloadUrl); }, 100); // cleanup
            }
        },
