        getFormattedDate:function(date, is12hourFormat) {
            if(!date) return;

            if(!(date instanceof Date)){
                date = new Date(date);
            }
            var is12HourFormat = is12hourFormat || false;
            var offsetTime = new Date(date.getTime() + (-1 * (date.getTimezoneOffset() * 60 * 1000)));
            var splitArr = offsetTime.toUTCString().split(" ");
            var ampm = offsetTime.getUTCHours() <= 12 ?"AM":"PM";
            var formattedDate = "";
            var hours = ""+offsetTime.getUTCHours() > 9 ? offsetTime.getUTCHours() : "0"+offsetTime.getUTCHours();
            var mins = ""+offsetTime.getUTCMinutes() > 9 ? offsetTime.getUTCMinutes() : "0"+offsetTime.getUTCMinutes();
            if(splitArr.length > 3){
                formattedDate = splitArr[0]+"" + " "+splitArr[2]+ " "+splitArr[1]+" "+splitArr[3]+","+ " " + hours + ":"+ mins + " ";
                if(is12HourFormat){
                    //formattedDate += ampm;
                    hours>12?hours-= 12:hours;
                    formattedDate = splitArr[0]+"" + " "+splitArr[2]+ " "+splitArr[1]+" "+splitArr[3]+","+ " " + hours + ":"+ mins + " " + ampm ;
                }
            }
            return formattedDate;
        },

