                var serviceReadActionFlag = false;
                _.each(_privileges, function (privilege) {
                    privilege.name = privilege.name.replace(/\s|_/g, '-').toLowerCase();
                    if (privilege.name == "adc-management"
                        || privilege.name == "cgnat-management"
                        || privilege.name == "security-management"
                        || privilege.name == "ipsec-management"
                        && _.contains(privilege.action, "READ")) {
                        readServices = true;
                    }
                    if (privilege.name == "service-management" && _.contains(privilege.action, "READ")) {
                        serviceReadActionFlag = true;
                    }
                });

                if (readServices && !serviceReadActionFlag) {
                    _privileges.push({"name": "service-management", action: ["READ"]});
                }
                // backup user context for unknown properties
                __userContext = userContext;

                // push role type to array
