                                var allowedActions = [];
                                _.each(currentPrivilege.contextAction, function(aAction) {
                                    var actionName = aAction.name.toUpperCase();
                                    if (allowedActions.indexOf(actionName) == -1) {
                                        allowedActions.push(actionName);
                                    }
                                });
                                if (allowedActions.indexOf(action) != -1) {
                                    result = true;
                                }
