define('app',[
    'jquery',
    'underscore',
    'backbone',
    'helpers/i18n',
    'helpers/TemplateHelper',
    'helpers/common',
    'helpers/contextHelper',
    'helpers/contextHelperCN',
    'helpers/constants',
    'helpers/utils',
    'helpers/auth',
    'helpers/appEvents',
    'bootstrap',
    "mousewheel",
    'jscrollpane'
], function ($, _, Backbone, i18n, TemplateHelper, common, contextHelper, contextHelperCN, constants, utils, auth, appEvents) {
    var app = (function () {
        var instance;

        var getObject = function (obj, key) {
            var result = null;
            if (obj instanceof Array) {
                for (var i = 0; i < obj.length; i++) {
                    result = getObject(obj[i], key);
                }
            }
            else {
                for (var prop in obj) {
                    if (prop == key) {
                        return obj[prop];
                    }
                    if (obj[prop] instanceof Object || obj[prop] instanceof Array)
                        result = getObject(obj[prop], key);
                }
            }
            return result;
        };
        var deleteDeep = function (obj, key) {
            _.each(obj, function (v, k) {
                if (_.isArray(v) || _.isObject(v)) {
                    deleteDeep(v, key)
                }
                if (k == key) {
                    delete obj[k]
                }
            });
        };
        /* Get Navigation Menu list for the user from REDIS
           If the menu list is not yet saved in REDIS,
           the api (and function) will return string value 'default-menu'
         */
        var getNavigationMenu =  function(){
            var returnVal = 'default-menu';
            $.ajax({
                type     : "GET",
                async    : false,
                url      : '/versa/users/'+userContext.username+'/dashboards/navigationmenu',
                headers : {"accept": 'application/json', "content-type" : "application/json" },
                success  : function(data, textStatus, jqXHR){
                    returnVal = data;
                },
                error    : function(data, textStatus, jqXHR) {
                }
            });
            new SharedDashboards().fetch({
                async: false,
                success: function (collection, response, options){
                    for(var i=0;i<collection.length;i++){
                        if(collection.models[i].get('mask')){
                            var attrs = collection.models[i].toJSON();
                            attrs.position = returnVal.length + 1;
                            returnVal.push(attrs);
                        }
                    }
                },
                error: function (response){
                    console.warn('Failed to fetch the dashboards shared with the user');
                }
            });

            new SharedDashboards({
                user: 'all'
            }).fetch({
                async:false,
                success: function (collection, response, options){
                    for(var i=0;i<collection.length;i++){
                        if(collection.models[i].get('mask') && (collection.models[i].get('owner') != userContext.username)){
                            var attrs = collection.models[i].toJSON();
                            attrs.position = returnVal.length + 1;
                            returnVal.push(attrs);
                        }
                    }
                },
                error: function (collection, response, options){
                    console.warn('Failed to fetch the dashboards shared with all the users');
                }
            });

            return returnVal;
        };
        var getIntegratedDashboardsPreferences = function (){
            var returnVal = [];
            $.ajax({
                type     : "GET",
                async    : false,
                url      : '/versa/user/'+userContext.username+'/preferences/integrated_dashboards',
                headers : {"accept": 'application/json', "content-type" : "application/json" },
                success  : function(data, textStatus, jqXHR){
                    returnVal = data;
                },
                error    : function(data, textStatus, jqXHR) {
                }
            });

            return returnVal;
        };

        var createGUID = function createGuid() {
            return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function(c) {
                var r = Math.random()*16|0, v = c === 'x' ? r : (r&0x3|0x8);
                return v.toString(16);
            });
        };

        function init() {
            var userLanguage,
                authInstance = auth.init(userContext);

            userLanguage = localStorage.getItem("lang") || "en";
            // userLanguage = authInstance.getUserLanguage();
            var contextHelperData;
            if (userLanguage === "en") {
                contextHelperData = contextHelper;
            }
            if (userLanguage === "cn") {
                contextHelperData = contextHelperCN;
            }
            userContext = authInstance.__getUserContext();
            if(userContext && userContext.privileges){
                _.each(userContext.privileges,function(privalage){
                    if(privalage.action){
                        if(_.contains(privalage.action,'READ-CONTENT') && _.contains(privalage.action,'READ')){
                            privalage.action = _.reject(privalage.action, function (value){
                                return value ==="READ-CONTENT"
                            });
                        } else if(_.contains(privalage.action,'READ-CONTENT')){
                            var position = _.indexOf(privalage.action,'READ-CONTENT');
                            privalage.action[position] = "READ";
                        }
                    }
                });
            }
            Highcharts.setOptions({
                chart:{
                    style:{
                        fontFamily:'"Roboto",sans-serif'
                    }
                },
                global: {
                    useUTC: false
                }
            });
            i18n.initialize(userLanguage);


            // initialize common utility
            common.initialize();

            return {
                templateHelper: TemplateHelper,
                events: appEvents,
                constants: constants,
                common: common,
                contextHelper:contextHelperData,
                utils: utils,
                flags: {},
                createGUID: createGUID,
                getObject: getObject,
                searchDeep: utils.searchDeep,
                deleteDeep: deleteDeep,
                auth: authInstance,
                userContext: userContext
            };
        }

        return {
            getInstance: function () {
                if (!instance) {
                    instance = init();
                }
                return instance;
            }
        };
    })();

    return app.getInstance();
});

