define('models/appliance',['jquery', 'underscore', 'backbone', 'app'],
    function ($, _, Backbone, app) {

        var versa = versa || {};
        versa.Appliance = Backbone.Model.extend({
            url: function () {
                return "/versa/vnms/appliances";
            },
            initialize: function () {

            },
            defaults: {
                name: '',
                totalOrganizations: '',
                applianceType: '',
                totalServices: '',
                unavailableServices: '',
                networkTraffic: '12',
                capacityUtilization: {total: '', utilized: '', unit: ''},
                userFavorite: '',
                status: '',
                tags: '',
                cardSize: function () {
                    /* var cssName = 'height-medium';
                     if(this.status == 'OK' ){
                     cssName = 'height-small';
                     } else if (this.status == 'CRITICAL'){
                     cssName = 'height-large';
                     }
                     return cssName;   */

                    return  app.constants.status[this.status].cardSize;
                },
                progressBarColor: function () {
                    var color = 'redColor';
                    if (this.capacityUtilization.utilized <= 50) {
                        color = 'greenColor';
                    }
                    return color;
                },
                statusIcon: function () {
                    var statusIconCss = '';
                    if (this.status == 'CRITICAL') {
                        statusIconCss = 'icon-redDot';
                    } else if (this.status == 'WARNING') {
                        statusIconCss = 'icon-orangeDot';
                    }
                    return statusIconCss;
                },
                applianceTypeLabel: function () {
                    return  app.constants.applianceType[this.applianceType].label;
                }

            }

        });

        return versa.Appliance;
    });

/**
 * Collection of appliances
 */
define('collections/appliances',[
        'jquery',
        'underscore',
        'backbone',
        'app',
        'models/appliance'
    ],
    function ($, _, Backbone, app, Appliance) {
        var versa = versa || {};
        versa.ApplianceCollection = Backbone.Collection.extend({
            model: Appliance,
            dataType: 'application/json',
            /**
             * Returns the URL string for fetching the organisation record from teh server.
             * @returns {String} URL
             */
            url: function () {
                return app.constants.APP_ROOT + '/ncs-services/vnms/appliance/appliance?offset=' + this.offset + '&limit=' + (this.offset + this.limit);
            },
            offset: 0,
            limit: 25,
            parse: function (response) {
                _.each(response['versanms.ApplianceStatusResult']['appliances'], function (card) {
                    card.id = card.uuid;
                    card.currentVersion = (card.currentVersion) ? card.currentVersion : 'NA';
                });
                return response['versanms.ApplianceStatusResult']['appliances'];
            }
        });
        return versa.ApplianceCollection;
    });

