/**
 * @fileOverview
 * This view renders the appliance card shown on the appliance dashboard.
 */
define('views/applianceCard',[
    'jquery',
    'underscore',
    'backbone',
    'app',
    'views/appliance',
    'text!templates/applianceCard.dust',
    'gridster'
], function ($, _, Backbone, app, ApplianceView, applianceCardTemplate, gridster) {
    var versa = versa || {};
    versa.ApplianceCardView = ApplianceView.extend({
        templateKey: 'applianceCard',
        events: function () {
            return _.extend({}, ApplianceView.prototype.events, {
                'click .appliance': 'renderApplianceDetailsView'
            });
        },
        /**
         * Initializes the appliance card view
         */
        initialize: function () {
            var serviceStatus;
            if (this.model.get('remoteApplianceId')) {
                if (this.model.collection.findWhere({id: this.model.get('remoteApplianceId')}) !== undefined) {
                    this.model.set({remoteApplianceName: this.model.collection.findWhere({id: this.model.get('remoteApplianceId')}).get('name')});
                } else {
                    this.model.set({remoteApplianceName: 'Not Available'});
                }
            } else {
                this.model.set({remoteApplianceName: 'Not Configured'});
            }
            if (this.model.get('createdAt')){
                var createdAt = this.model.get('createdAt');
                this.model.set({createdAt:new Date(createdAt)});
            }
            if (this.model.get('branchId')){
                var branchID = this.model.get('branchId');
                if (branchID == ''){
                    this.model.set({branchId:'-'});
                }
            }else {
                this.model.set({branchId:'-'});
            }

            if (this.model.get('ping-status') && this.model.get('ping-status') == 'REACHABLE'){
                serviceStatus = this.model.get('services-status') && this.model.get('services-status') == 'GOOD' ? 'Up' : 'Down';
            } else {
                serviceStatus = 'N/A';
            }
            this.model.set({'overall-status':serviceStatus});

            app.templateHelper.compile(applianceCardTemplate, this.templateKey);
        },
        /**
         * Renders appliance card view
         * @returns {versa.ApplianceCardView}
         */
        render: function () {
            var data = this.model.toJSON();
            data.cid = this.model.cid;
            if (data && data.orgs && data.orgs.length == 1) {
                data['applianceType'] = "EXCLUSIVE";
            } else {
                data['applianceType'] = "SHARED";
            }
            if(data && data.type.toLowerCase() == "ucpe"){
                data.type = data.type.charAt(0) + data.type.slice(1).toUpperCase();
            }
            data['updgradeStatus'] = "";
            if (typeof data['ping-status'] != 'undefined') {
                if (data['ping-status'] === 'REACHABLE') {
                    data['updgradeStatus'] = 'success';
                } else if(data['ping-status'] === 'UNREACHABLE' ) {
                    data['updgradeStatus'] = 'failure';
                }
            }
            data['updgradeStatusUppercase'] = (data['updgradeStatus'] != "") ? data['updgradeStatus'].toUpperCase() : "";
            var orgList = app.auth.getUserOrganization();
            data.organizationId = '-';
            if(orgList && orgList.length){
                data.organizationId = data.ownerOrg;
            }
            this.$el.empty();
            this.setElement($(app.templateHelper.renderedOutput(this.templateKey, data)));
            this.$el.find('.card-content').jScrollPane({autoReinitialise: true});
            return this;
        },
        /**
         * Renders the appliance details
         * @param {Event} e the event object.
         */
        renderApplianceDetailsView: function (e) {
            if (!($(e.target).hasClass('chkbx'))) {
                this.undelegateEvents();
                this.close();
                app.router.applicationEvents.trigger('update-top-navigation', "appliances", this.model.get("name"));
            }
        }
    });
    return versa.ApplianceCardView;
});


define('text!templates/applianceRecord.dust',[],function () { return '<tr data-modelid="{name}"><td align="center"><div class="ciCheckbox"><span class="chkbx icon-uncheckedNew"></span></div></td><!-- <td align="center">\n    {@eq key="{userFavourite}" value="true"}\n        <span id="favourite" class="sprite icon-star icon-star-yellow"></span>\n    {:else}\n        <span id="favourite" class="sprite icon-star"></span>\n    {/eq}\n    </td>--><td><a class="confdLink" data-link="{ipAddress}">{name}</a> {@ne key="{statusIcon}" value=""}<span class="sprite {statusIcon} pull-right"></span>{/ne}</td><td class="align-left">{ipAddress}</td><td class="align-left">{organizationId}</td><td class="align-left">{cmsOrg}</td><td class="align-left">{applianceType}</td><td class="align-left">{nmsOrgsCount}</td><td class="align-left">{sngCount}</td></tr>';});

/**
 * This file displays the record of a single appliance.
 * For each appliance this file is called.
 */
define('views/applianceRecord',[
    'jquery',
    'underscore',
    'backbone',
    'app',
    'views/appliance',
    'text!templates/applianceRecord.dust'
], function ($, _, Backbone, app, ApplianceView, applianceRecordTemplate) {
    var versa = versa || {};
    versa.ApplianceRecordView = ApplianceView.extend({
        templateKey: 'applianceRecord',
        events: function () {
            return _.extend({}, ApplianceView.prototype.events, {
                // child events
                'click .confdLink': 'renderApplianceDetailsView',
                'click': 'renderApplianceDetailsView'
            });
        },
        /**
         * Initializes appliance Record View
         */
        initialize: function () {
            this.data = this.model.toJSON();
            this.data.cid = this.model.cid;
            this.event = this.options.event;
            app.templateHelper.compile(applianceRecordTemplate, this.templateKey);
        },
        /**
         * Renders appliance record View.
         * @returns {versa.ApplianceRecordView}
         */
        render: function () {
            this.setElement($(app.templateHelper.renderedOutput(this.templateKey, this.data)));
            return this;
        },
        /**
         * Opens the appliance with the help of its IP for fetching the appliance details from the NCS
         * @param {Event} ev the event object.
         */
        openConfd: function (ev) {
            ev.stopPropagation();
            var ip = $(ev.currentTarget).data('link');
            window.open('http://' + ip + ':8008');
        },
        /**
         * Renders appliance details view
         * @param {Event} e the event Object
         */
        renderApplianceDetailsView: function (e) {
            if (!($(e.target).hasClass('chkbx'))) {
                var url = 'appliance/' + this.model.get('applianceId');
                app.router.applicationEvents.trigger('addBreadCrumbAtRuntime', this.model.get('name'), url, 'applianceView', {id: this.model.get('applianceId'), appName: this.model.get('name')});
                this.undelegateEvents();
            }
        }
    });
    return versa.ApplianceRecordView;
});


